import './TodoItem.css';

const TodoItem = () => {
  return(
    <div className='TodoItem'>
      <div className='checkbox_col'>
        <input type="checkbox"/>
      </div>
      <div className="title_col">Todo</div>
      <div className="date_col">{new Date().toLocaleDateString()}</div>
      <div className='btn_col'>
        <button>삭제</button>
      </div>
    </div>
  )
}

export default TodoItem;
